import axios from "axios";

function Counter() {
  const [data, setData] = useState([]);
  useEffect(() => {
    const data = async () => {
      const response = await axios.get(
        "https://jsonplaceholder.typicode.com/posts"
      );
      setData(response);
      console.log(data);
    };
  }, []);
  return (
    <div>
      <p>111</p>
    </div>
  );
}

export default Counter;
